import React from 'react';
import { Grid,Typography,Button, AppBar, Toolbar, IconButton } from '@mui/material';
import { styled } from '@mui/material/styles';
import {useNavigate} from 'react-router-dom';
import Charity from '../../images/charityHelp.jfif';
import '../../css/Home.css';
import Kids from '../../images/hunger.jfif';


const StartButton = styled(Button)(({ theme }) => ({
  color: 'theme.pallette.text',
  backgroundColor: 'theme.pallete.main',
  '&:hover': {
    backgroundColor: '#000000',
  },
}));

const StyledButton = styled(Button)(({ theme }) => ({
  color: 'theme.pallette.text',
  backgroundColor: 'theme.pallete.main',
  '&:hover': {
    backgroundColor: '#000000',
  },
}));

const Styledappbar = styled(AppBar)(({theme}) =>({
  backgroundColor:'#000000',
  display:'flex',
  height:'10vh',
  width:'100%'
}));


export default function Home() {
  let navigate = useNavigate();

  let startButtonClick = ()=>{
    navigate('/login');
  }



  return (
    <div>
      <Styledappbar position='static' elevation={4}>
        <Toolbar>
          <Typography variant='h4' sx={{flex:1}}>
            Eden's Garden
          </Typography>
          <StartButton onClick={startButtonClick}>
            Login
          </StartButton>
        </Toolbar>
      </Styledappbar>
      <div className='container'>
        Hello World
      </div>
    </div>
  );
}
